import React from 'react';
import logo from './logo.svg';
import './App.css';
import SignUp from './components/SignUp';


const App = () => (
  <Router>
    <Switch>
      <Route exact path="/" component={SignUp} />
    </Switch>
  </Router>
);

export default App;
